import { Injectable } from '@angular/core';
import { Car } from './car.model';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  private carros: Car[] = [
    { id: 1, name: 'Carro 1', licence: 'ABC-123', deleted: false },
    { id: 2, name: 'Carro 2', licence: 'DEF-456', deleted: true },
    { id: 3, name: 'Carro 3', licence: 'GHI-789', deleted: false },
    { id: 4, name: 'Carro 4', licence: 'JKL-012', deleted: true },
    { id: 5, name: 'Carro 5', licence: 'MNO-345', deleted: true }
  ];

  constructor() {}

  getCarros(): Car[] {
    return this.carros;
  }

  getHistoricoDeletados(): Car[] {
    return this.carros.filter(car => car.deleted);
  }
}
